<style>
    .bg-container {
        background-color: #dd6804;
        min-height: 100vh;
        min-width: 100vw;
        position: fixed;
        /* horizontally and vertically center the children */
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
    }

    .bg {
        background-color: #dd6804;
        display: table;
        margin: 0 auto;
        transform: scale(0.5);
    }

    .gutter {
        height: 35px;
        border-radius: 35px;
        background: #333;
        box-shadow: inset 5px 5px 10px #1f1f1f, inset -5px -5px 10px #474747;
        max-width: 100%;
        width: 400px;
        min-width: 400px;
        position: absolute;
        left: calc(50% - 200px);
    }

    @keyframes progress {
        from {
            width: 30px;
            transform: translateX(0px);
        }

        50% {
            width: 200px;
            transform: translateX(0px);
        }

        75% {
            transform: translateX(200px);
            width: 200px;
        }

        100% {
            transform: translateX(calc(400px - 30px));
            width: 30px;
        }
    }

    .progress {
        height: 35px;
        border-radius: 35px;
        display: inline-block;
        width: 30px;
        background: linear-gradient(0deg, #dd6804 0%, #f5a558 100%);
        box-shadow: 0px 0px 12px 0px #dd6804;
        position: absolute;
        z-index: 1;
        animation: progress 1.5s infinite;
        animation-direction: alternate;
        animation-timing-function: linear;
        left: calc(50% - 200px);
    }

    .progress-viewer {
        position: fixed;
        left: calc(50vw);
        bottom: 200px;
        z-index: 20;
    }
</style>
